import React from "react";

function ExerciseList(props)
{
    <div className="term">
    <dt>
      <span className="emoji" role="img" aria-label="Tense Biceps">
        {/* <img src={props.img} alt="exercise"></img> */}
        {props.emoji}
      </span>
      <span>{props.name}</span>
    </dt>
    <dd>
      {props.description}
    </dd>
  </div>
}
export default ExerciseList;
